import styled from 'styled-components';
import Logo from './image.jpg';

export const Wrapper = styled.div`
	padding: 15px;
	color: white;
	width: 20em;
    height: 20em;

`;

export const Text = styled.div`

	max-width: 300px;
	background: rgba(0,0,0,0.4);
	border-radius: 20px;

`;
